import '../css/Registration.css'
import sideimage from './sideimage.jpg'
import 'bootstrap/dist/css/bootstrap.css';
const Registration = () => {
    return (
        <div className='container my-5'>
            <div className=' shadow row p-5'>
                <div className='col-5'>
                    <img className='img-fluid' src={sideimage} alt='notfound' />
                </div>
                <div className='col-7'>
                    <h2>Register </h2>
                    <p className='lead'></p>
                </div>
            </div>

        </div>
    )
}
export default Registration;
